import React, {Component} from 'react';
import ChatBot from 'react-simple-chatbot';

const ChatSteps = [
        {
            id: 'intro',
            message: 'Hello.',
            trigger: 'agreement',
        },{
             id: 'agreement',
            message: 'Would you like to submit a patient reqeust?',
            trigger: 'intro-patient'
        },{
            id:'intro-patient',
            options:[
                {value:'y',label: "Yes",trigger:"enter_name"},
                {value:'n',label: "No", trigger:"end-chat"},
            ]

        },
        {
            id:'end-chat',
            message: 'No worries, have a great day',
            end: true,
        },
        {
            id: 'enter_name',
            message: 'Please enter your legal name:',
            trigger: 'patient_name'
          },{

            id: 'patient_name',
            user: true,
            trigger: '3',
          },
          {
            id: '3',
            message: "hi {previousValue}, how may I help you?",
            trigger: '4',
          },{

            id: '4',
            message: "what's up",
            end: true
          }

    ];
class PatientForm extends Component{
    render(){
        return(
             <ChatBot steps={ChatSteps} />
        )
    }
}

export default PatientForm;
